"    <div id=\"topicTitle\">",
"     Patient information: Chest pain (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/chest-pain-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H26441468\">",
"      <span class=\"h1\">",
"       Should I call 9-1-1 for an ambulance if I have chest pain?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should call 9-1-1 if the pain:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Is new or severe",
"       </li>",
"       <li>",
"        Happens along with shortness of breath",
"       </li>",
"       <li>",
"        Lasts more than a few minutes",
"       </li>",
"       <li>",
"        Gets worse when you walk, climb stairs, or do other types of physical activity",
"       </li>",
"       <li>",
"        Scares or worries you",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Having chest pain does not necessarily mean you are having a heart attack. Most people who go to the emergency room with chest pain are",
"      <strong>",
"       not",
"      </strong>",
"      having a heart attack. Their pain is usually caused by less serious problems, such as muscle pain or heartburn. Even so, you should not take any chances.",
"     </p>",
"     <p>",
"      People often delay seeking help for a heart attack because they think the symptoms are not serious or will go away. When they do that, they risk permanent damage to their heart&mdash;or even death.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26441475\">",
"      <span class=\"h1\">",
"       Is chest pain the only important symptom of a heart attack?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. Other symptoms are important, too. Sometimes people do not go to the hospital because they do not have any pain at all. But it is possible to have a heart attack without pain. This is more likely in women, people with diabetes, and people older than 60.",
"     </p>",
"     <p>",
"      It is important to pay attention to any of the symptoms of a heart attack, (",
"      <a class=\"graphic graphic_figure graphicRef52579 \" href=\"UTD.htm?1/15/1268\">",
"       figure 1",
"      </a>",
"      ), which can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain, pressure, or discomfort in the center of the chest",
"       </li>",
"       <li>",
"        Pain, tingling, or discomfort in other parts of the upper body, including the arms, back, neck, jaw, or stomach",
"       </li>",
"       <li>",
"        Shortness of breath",
"       </li>",
"       <li>",
"        Nausea, vomiting, burping, or heartburn",
"       </li>",
"       <li>",
"        Sweating or having cold, clammy skin",
"       </li>",
"       <li>",
"        A racing or uneven heart rate",
"       </li>",
"       <li>",
"        Feeling dizzy or lightheaded or even fainting",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      These symptoms are important if they last more than a few minutes or keep happening over and over (coming and going). If you think you may be having a heart attack, call 9-1-1 right away. Do not try to get to the hospital on your own.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26441482\">",
"      <span class=\"h1\">",
"       Is heart attack the only cause of chest pain?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. Chest pain can be caused by lots of other problems, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Heart problems other than heart attacks, such as infection around the heart",
"       </li>",
"       <li>",
"        Muscle soreness after an activity that involves the chest muscles",
"       </li>",
"       <li>",
"        Diseases that cause pain, such as arthritis",
"       </li>",
"       <li>",
"        Shingles (herpes zoster), a condition linked to the chickenpox virus that also causes a painful rash",
"       </li>",
"       <li>",
"        Any kind of injury to the chest, including surgery",
"       </li>",
"       <li>",
"        Digestive problems such as heartburn, acid reflux, stomach ulcers, or irritable bowel syndrome",
"       </li>",
"       <li>",
"        Problems affecting the lungs, such as pneumonia (an infection in the lungs) or blood clots in the lungs",
"       </li>",
"       <li>",
"        Psychological problems, such as panic disorder or depression",
"       </li>",
"       <li>",
"        Weakening of the lining of the big blood vessel in the chest (the aorta)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26441489\">",
"      <span class=\"h1\">",
"       What will happen if I go to the emergency room?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The people treating you in the emergency room will examine you and then run tests to try to find the cause of your pain. But don&rsquo;t be surprised if you do not find out right away why you have pain. The cause of chest pain is not always easy to find. Even so, doctors can usually tell if your heart is in trouble.",
"     </p>",
"     <p>",
"      The tests you might have include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         An electrocardiogram (ECG or EKG)",
"        </strong>",
"        &mdash; This test measures the electrical activity in your heart. It can help doctors find out if you are having a heart attack.",
"       </li>",
"       <li>",
"        <strong>",
"         Blood tests",
"        </strong>",
"        &mdash; During a heart attack, the heart releases certain chemicals. If these chemicals are in your blood, it might mean you are having a heart attack.",
"       </li>",
"       <li>",
"        <strong>",
"         A stress test",
"        </strong>",
"        &mdash; During a stress test, you might be asked to run or walk on a treadmill while you also have an ECG. Physical activity increases the heart&rsquo;s need for blood. This test helps doctors see if the heart is getting enough blood. If you cannot walk or run, your doctor might do this test by giving you a medicine to make your heart pump faster.",
"       </li>",
"       <li>",
"        <strong>",
"         Cardiac catheterization",
"        </strong>",
"        &mdash; Cardiac (heart) catheterization is also known as cardiac &ldquo;cath&rdquo; or coronary angiography. During this test the doctor inserts a thin tube into a large artery in your leg or arm and advances it to your heart. Then the doctor injects a dye that shows up on an x-ray. This dye can show whether any of the arteries in your heart is clogged.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26441496\">",
"      <span class=\"h1\">",
"       What if I am having a heart attack?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are having a heart attack, the doctor will give you treatments to reduce the damage to your heart and relieve your pain. These treatments include pills, medicines that go right into a vein (through an &ldquo;IV&rdquo;), and possibly a treatment called &ldquo;angioplasty.&rdquo; During angioplasty, a doctor puts a thin tube into a blood vessel in the leg or arm and advances it to the heart. Then the doctor inflates a tiny balloon inside the clogged artery to reopen it. Often the doctor props open the artery using a tiny mesh tube called a stent.",
"     </p>",
"     <p>",
"      The sooner you get treated for a heart attack, the better treatment will work. Every minute counts when it comes to keeping your heart muscle alive!",
"     </p>",
